import React, {Component} from 'react';
import './Dashboard.css';

class Dashboard extends Component {
  render() {
    return (
      <div className="Dashboard">
          <h1 className="Dashboard-title">COVID-19 Dashboard</h1>
      </div>
    );
  }
}

export default Dashboard;
